import "./css/Navbar.css";
import SocialPanel from "./SocialPanel";
import logo from "./icons/slice1.svg";

function Navbar(props) {
  return (
    <div className="bar">
      <div className="logo-n">
        N<span className="logo-p">P</span>
      </div>
      <img
        src={logo}
        className="icon"
        alt="Email me"
        width="32"
        height="32"
      ></img>
      <SocialPanel />
    </div>
  );
}

export default Navbar;
